  true,\n\t\"url\": null,\n\t\"notes\": \"This resource area contains descriptions
  of actual electronic systems failurernscenarios with an emphasis on the diversity
  of failure modes and effects thatrncan befall dependable systems.rnrnIntroductory
  pages begin [here](/dashlink/static/media/other/Introduction1.html).<br>rnThe descriptions
  beginrn[here](/dashlink/static/media/other/ObservedFailures1.html).  These pages
  arernseparated into sections.  Each section starts with a List of failure scenarios.
  \ rnIn between the List slides are slides that give more information on thosernscenarios
  which warrant more than a bullet or two of explanation.<br>rnSome references are
  listed [here](/dashlink/static/media/other/References.html).<br>rnA list of acronyms
  and initialisms isrn[here](/dashlink/static/media/other/Acronyms_Initialisms.html).rnrnIf
  you would like to add a story to this list or add additional significantrndetails
  to an existing story, please contact Kevin Driscoll atrn![](/dashlink/static/media/other/KevinDriscoll-email.PNG)rnrnFor
  a not-quite-working wiki subset of this Resource area, click on the Wiki link just
  to the left of this Summary or go to the URL [https://c3.nasa.gov/dashlink/projects/79/wiki/test_stories_split](/dashlink/projects/79/wiki/test_stories_split).rnrnAlso,
